        super(props)
        this.state = {
            store: storeProducts.data,

        }
    }


    render() {
        var temp = {};
        let store = this.state.store;
        // var items = json.store;
        var category = {};
        var month = {};
        var result = [];
        for (var item, i = 0; item = store[i++];) {
            let element = item;
            category[item.category] = 1;
            result.push(Object.values(element));

        }
